import React from 'react';

const Nav = () => (
    <nav class>
            <ul className='flex space-x-4 justify-end'>
                <li><a href="#">Home</a></li>
                <li><a href="#">About</a></li>
                <li><a href="#">Contact</a></li>
            </ul>
        </nav>
);

export default Nav;
